DROP TABLE IF EXISTS `spawnlist`;
CREATE TABLE `spawnlist` (
  `spawn_id` int(11) NOT NULL AUTO_INCREMENT,
  `location` varchar(50) NOT NULL DEFAULT '',
  `count` int(11) NOT NULL DEFAULT '0',
  `npc_templateid` int(11) NOT NULL DEFAULT '0',
  `locx` int(11) NOT NULL DEFAULT '0',
  `locy` int(11) NOT NULL DEFAULT '0',
  `locz` int(11) NOT NULL DEFAULT '0',
  `randomx` int(11) NOT NULL DEFAULT '0',
  `randomy` int(11) NOT NULL DEFAULT '0',
  `heading` int(11) NOT NULL DEFAULT '0',
  `respawn_delay` int(11) NOT NULL DEFAULT '0',
  `respawn_random` int(11) NOT NULL DEFAULT '0',
  `loc_id` int(11) NOT NULL DEFAULT '0',
  `last_editor` varchar(50) DEFAULT 'Local',
  `last_changed` varchar(20) DEFAULT NULL,
  `ai` varchar(100) DEFAULT NULL,
  `ai_parameters` varchar(1000) DEFAULT NULL,
  `event_name` varchar(100) DEFAULT NULL,
  `spawn_time` varchar(100) DEFAULT NULL,
  `periodOfDay` tinyint(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`spawn_id`),
  UNIQUE KEY `npc_templateid` (`npc_templateid`,`locx`,`locy`,`locz`,`loc_id`,`event_name`),
  KEY `key_npc_templateid` (`npc_templateid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

